import React from 'react'
import styled from 'styled-components'

const PreviewDiv = styled.div`
  flex-basis: 50%;
`

const TitleH1 = styled.h1`
  width: 100%;
  text-align: center;
  margin-bottom: 1em;
  color: #594545;
`

const CardsUl = styled.ul`
  width: 100%;
  height: 100%;
  list-style: none;

`

const Preview1210 = () => {
  return (
    <PreviewDiv>
      <TitleH1>Card Preview</TitleH1>
      <CardsUl>
        <li>김유신</li>
        <li>강감찬</li>
        <li>이성계</li>
      </CardsUl>
    </PreviewDiv>
  )
}

export default Preview1210
